n. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",gxc='Dimension',djc='Dimension [height=',wtc='DirectionalTextHelper',ztc='DockLayoutPanel',Atc='DockLayoutPanel$Direction',Btc='DockLayoutPanel$Direction;',Etc='DockLayoutPanel$DockAnimateCommand',Ctc='DockLayoutPanel$LayoutData',Jpc='DomEvent',Opc='DomEvent$Type',Qvc='Double',fgc='EAST',tac='EEE, d MMM yyyy HH:mm:ss Z',Ylc='EEE. dd MMM. yyyy HH:mm:ss',Nac='EEEE, MMMM d',wac='EEEE, MMMM d, y',$7b='EM',Odc='EMPTY',Tdc='ENABLED',$bc='END',a8b='EX',esc='ElementMapperImpl',fsc='ElementMapperImpl$FreeNode',Pbc='English',Woc='Enum',Gbc='Etc/GMT',Ibc='Etc/GMT+',Hbc='Etc/GMT-',p8b='Event type',Wuc='Event$NativePreviewEvent',_pc='EventBus',loc='EventObject',qoc='Exception',Nec='Expecting version 6 from server, got ',k9b='F',fkc='F8834F07517EF3B7D02B9E845E5E1B88',V7b='FIXED',jfc='FLOAT',Pjc='Fail: ',E9b='Feb',s9b='Febr
